          img: "https://dummyimage.com/420x260",   
          width: "420",
          height: "260",
          price: 12.0,
        },
        {
          name: "The 400 Blows",
          category: "CATEGORY",
          img: "https://dummyimage.com/420x260",
          width: "420",
          height: "260",
          price: 18.4,
        },
        {
          name: "The Catalyzer",
          category: "CATEGORY",
          img: "https://dummyimage.com/420x260",    
          width: "420",
          height: "260",
          price: 16.0,
        },
        {
          name: "Shooting Stars",
          category: "CATEGORY",
          img: "https://dummyimage.com/420x260",
          width: "420",
          height: "260",
          price: 21.15,
        },
        {
          name: "Neptune",
          category: "CATEGORY",
          img: "https://dummyimage.com/420x260",
          width: "420",
          height: "260",
          price: 12.0,
        },
        {
          name: "The 400 Blows",
          category: "CATEGORY",
          img: "https://dummyimage.com/420x260",
          width: "420",
          height: "260",
          price: 18.4,
        },
      ];

      const content = (isFirstMount) => ({
        animate: {
          transition: { staggerChildren: 0.1, delayChildren: isFirstMount ? 2.8 : 0 },
        },
      });

      const title = {
        initial: { y: -20, opacity: 0 },
        animate: {
          y: 0,
          opacity: 1,
          transition: {
            duration: 0.7,
            ease: [0.6, -0.05, 0.01, 0.99],
          },
        },
      };

      const products = {
        initial: { y: -20, opacity: 0 },
        animate: {
          y: 0,
          opacity: 1,
          transition: {
            duration: 0.7,
            ease: [0.6, -0.05, 0.01, 0.99],
          },
        },
      };

    return (

        <motion.section exit={{ opacity: 0 }}>
      {isFirstMount && <InitialTransition />}   
      <div className="flex flex-col min-h-screen">

<motion.div
initial="initial"
animate="animate"
variants={content(isFirstMount)}
className="space-y-12"
>
<motion.h1 variants={title} className="text-6xl font-black text-center">
  Welcome to tailstore!!

</motion.h1>


<motion.section variants={products} className="text-gray-700 body-font">




  <div className="container px-5 pt-12 mx-auto">
    <div className="flex flex-wrap -m-4">
      {productsDb.map((product, index) => (
        <Product key={index} {...product} />
      ))}
    </div>
  </div>
</motion.section>
</motion.div>
</div>
</motion.section>
    );
  };

export default FallText;
